textOriginal:
assinale a alternativa correta(no tocante às eleições):

O que fazer para impedir lula de.ganhar as eleições?

A) Dizer que as urnas são fraude, que nas rádios tem.fraude, que tudo é uma fraude;
B) Mentir descaradamente sobre o adversário;
C) atacar o supremo e o TSE;
D) incentivar a população a cometer crimes eleitorais e violência contra os oponentes;
(E) Adiar as eleições;
(x) (F) todas alternativas estão corretas
